insert  into `news`(`ID_News`,`News_Date`,`Expiration_Date`,`News_Headline_GE`,`News_Headline_GB`,`News_Headline_PT`,`News_Headline_PL`,`News_GE`,`News_GB`,`News_PL`,`News_PT`,`News_File`,`News_Link`,`News_Language`,`News_Remarks`,`LastAdmin_News`,`Timestamp`) values (1,'2007-06-01','2007-12-31','Packmitteldatenbank im Internet online','Packaging database is now online in internet','Only in German and English availible.','Only in German and English availible.',NULL,NULL,NULL,NULL,NULL,NULL,'GE, GB',NULL,'Scholzen','2009-01-15 13:58:58'),(2,'2007-07-08','2007-12-31','Informationen neu strukturiert','Information in new structure','Only in German and English availible.','Only in German and English availible.',NULL,NULL,NULL,NULL,NULL,NULL,'GE, GB',NULL,'Scholzen','2009-01-15 13:58:58'),(3,'2008-06-23','2999-01-01','Gebindestraffung in Siegburg','Lean the packaging catalog','','','Durch die Transfers wurden etliche neue Verpackungen in Siegburg eingef�hrt. Die jetzige Gebindestraffung soll die Platzprobleme, die Komplexit�t und damit die Kosten reduzieren. Etliche \"low runner\" stehen auf dieser Liste. Auch der Kunststoff-IBC VPS 601, seit 2006 durch den VPS 600 abgel�st, soll nun verschwinden. N�here Infos in der beigef�gten Pr�sentation. ','With the product transfers many new packaging materials has been implemented at SCM Siegburg. To lean the cataloge quantity, complexity and costs of packaging materials and processes should be reduced. Different \'low runner\' - mainly used by existing clients - are on the elemination list. You will find further information within the presentation. ','With the product transfers many new packaging materials has been implemented at SCM Siegburg. To lean the cataloge quantity, complexity and costs of packaging materials and processes should be reduced. Different \'low runner\' - mainly used by existing clients - are on the elemination list. You will find further information within the presentation. ','With the product transfers many new packaging materials has been implemented at SCM Siegburg. To lean the cataloge quantity, complexity and costs of packaging materials and processes should be reduced. Different \'low runner\' - mainly used by existing clients - are on the elemination list. You will find further information within the presentation. ','uploads/NEWS/ppt_statuslist.gif','Packaging materials at SCM Siegburg_Rev2008-06-23.pdf',NULL,'','scholzen','2009-12-17 17:12:47'),(4,'2008-06-23','2008-12-31','Einf?hrung des VPS 226 in Siegburg','Implementation of pail VPS 226 at Siegburg','','','Die Einf�hrung des 25L Hobbocks (EMEA Standard) soll weiter die Produktkosten senken. Zielgruppe sind die Kunden, die nur 20kg F�llmenge in den Hobbocks verlangen. N�here Infos in der beigef�gten Pr�sentation. ','The implementation of this 25L pail (EMEA standard) should reduce the product costs. Target customers are those who are receiving today only 20kg within the 30L pail from Siegburg. Further information to the project schedule within the presentation. ','','','',NULL,NULL,'','scholzen','2009-01-15 14:01:00'),(5,'2008-11-29','2009-06-30','Status der Implemetierung VPS 226','Status of implementing VPS 226','','','Der Hobbock VPS 226 f�r 20kg ist f�r Lieferungen nach Frankreich, Spanien und Benelux eingef�hrt.\r\nMit diesem Meilenstein sind 60% des Projekts umgesetzt.\r\nN�chster Schritt ist, die St�cklisten f�r England/ UK umzustellen. ','The standard EMEA pail for 20kg VPS 226 (at Annemasse SU026) is now implemented for IC deliveries from Siegburg to France, Spain and Benelux.\r\nWith reaching this milestones 60% of the project is set up. Next step is to exchange all items lists for UK. ','','','uploads/NEWS/ppt_pail.gif','',NULL,'','scholzen','2009-06-02 17:06:20'),(6,'2008-12-15','2009-03-31','Annemasse stellt auf ATEX-IBC um','Annemasse implements ATEX plastic IBC','','','Innerhalb der n�chsten Wochen werden in Annemasse alle Kunststoff-IBC f�r L�semittelfarben in EX-gesch�tzte Kunststoff-IBC umgestellt (VPS 615/ CS015). \r\nDies ist eine HSE Ma�nahme, um Mitarbeiter und Einrichtung zu sch�tzen.\r\nKunststoff ist ein isolierendes Material und daher ein potentielles Riskio f�r elektrostatische Aufladung. EX-gesch�tzte IBC haben eine antistatische Au�enschicht auf dem Innenbeh�lter, die vor statischer Aufladung sch�tzt.\r\nDer R�ckholprozess wird auch von einem gemischten Einweg-/ Mehrwegsystem auf reines Einweg umgestellt. \r\nDie Kunden k�nnen dabei das bekannte  R�ckholsystem Pack-One  nutzen. ','Within the next weeks in Annemasse all plastic IBC for solvent based inks would be changed to ATEX plastic IBC (VPS 615/CS015). This is a HSE requirement to protect workers and equipment.\r\nPlastic is an insulating material and therefore a potential risk for static electricity. These ATEX IBC have a special layer of antistatic plastic on the outside of the plastic bottle.\r\nThe return process of plastic IBC will also be changed from mixed one-way/ multi-trip to one-way. The customers shall use the return service of the IBC manufacturers, like Pack-One-Ticket. ','','','uploads/NEWS/R-IBC_ATEX.jpg','',NULL,'','scholzen','2009-06-02 17:06:19'),(7,'2008-12-15','2009-04-30','VPS 157 wird umgestellt','Downsizing of pail VPS 157','','','Das Projekt zur Reduzierung der Spezifikation des VPS 157 endet zum Jahresende mit der Umstellung auf die neue Spezifikation. Das damit erreichte Ziel des Projekts sind Einsparungem um 0,50 Euro pro Hobbock. \r\nUm sicherzustellen, da� die Qualit�t der reduzierten Spezifikation f�r transportzewcke ausreicht, wurden ein kleiner Feldversuch mit ausgew�hlten Kunden als auch ein Gro�versuch von August bis Oktober mit allen Kunden durchgef�hrt. Die Versuche haben gezeigt, da� trotz reduzierter Wandst�rke die Stabilit�t genau so hoch ist wie bei der bisherigen Ausf�hrung. Ohne jegliche Kundenreklamation war das Ergebnis des Tests wesentlich besser als erwartet.\r\nIm ersten Quartal 2009 werden dann alle Hobbocks (VPS 157, VPS 171, VPS 167) und F�sser (VPS 149, VPS 151) auf rote Au�enfarbe umgestellt. Damit w�ren dann alle wesentlichen Gebinde auf das Siegwerk-Rot umgestellt. ','The downsizing project of pail VPS 157 will be ended end of 2008 with implementing the new specification. The achieved goal of this project would be cost reduction of approx. 0,50 Euro per pail.\r\nTo be sure that the quality of the downsizes specification is good enough for transportation requirements, a small filed test with selected customers and an extended test with all customers of VPS 157 from August to October have shown that the pail with the reduced wall thickness is as stable as the black steel one. Without any claim from customers the result was much better than imagined before.\r\nIn the first quarter of 2009 all pails (VPS 157, VPS 171, VPS 167) and drums (VPS 149, VPS 151) will be changed to outside red color. The corporate red is than implemented over all packaging types and sizes. ','','','uploads/NEWS/Pails30L_red.jpg','',NULL,'','scholzen','2009-06-02 17:06:20'),(8,'2009-01-19','2009-01-21','Farbumstellung der Gebinde','Change of outside color of packagings','','','Die Verpackungen VPS 157, 171 (Hobbock 25kg), VPS149/ FH217 (Fa� 200kg) werden ab 1. April in roter Au�enfarbe geliefert.','For the packagings VPS 157, 171 (pail 25kg) and VPS 149 (drum 200kg) will be in corporate red from 1st of April.','only in German or English availible','only in German or English availible','uploads/NEWS/VPS165_red-grey.JPG','',NULL,'','scholzen','2009-02-02 08:02:55'),(9,'2009-02-01','2009-03-31','Funktion Packmittelingenieur aufgel?st','Function Packaging Engineering canceled','Function Packaging Engineering dissoute','','Mit dem 31. Januar 2009 wurde die Funktion \"Global Packaging Engineering\" aufgel�st. \r\nChristoph Scholzen, der die Funktion seit 2004 erfolgreich ausf�llte, wechselt als Stellvertretender Produktionsleiter in den Bereich SCM Packaging in Siegburg und berichtet an Markus Willeke.\r\nDie Funktion des Packmittel Ingenieurs werden nicht wieder besetzt.\r\n\r\nFragen zu Packmitteln richten Sie bitte prim�r an den Einkauf Packmittel, Thomas Ackermann.','With 31th of January 2009 the global function \"Packaging Engineering\" was canceled. \r\nChristoph Scholzen, who took this position, changed to SCM Packaging in Siegburg as Assistant to Head of production, Markus Willeke.\r\nThe function of the packaging engineer would not be reoccupied.\r\n\r\nOn request to packaging materials please contact the global purchaser, Thomas Ackermann.','see English/ German','La fonction \'Global Packaging Engineering\' � �t� dissoute � dater du 31 janvier 2009.\r\nChristoph Schlozen, ancien titulaire de cette fonction, occupe d�sormais la fonction \'Assistant to Head of Production\' adjoint pour SCM Packaging � Siegburg et d�pend hi�rarchiquement de Markus Willeke.\r\nLa fonction \'Global Packaging Engineering\' ne sera pas r�occup�e.\r\n\r\nMerci d\'adresser toute question relative aux emballages � Thomas Ackermann, service des achats.','uploads/NEWS/DSCN0591_1.JPG','',NULL,'','scholzen','2009-03-31 11:03:32'),(10,'2010-05-25','2012-12-31','Kundenwunschliste im SAP','Customer wishes in SAP','','','Siegburg: Die bisherigen Kundensonderw�nsche sind jetzt in Form von modifizierten Packvorschriften im SAP hinterlegt. \r\n�ber die Transaktionen ZMM_PACK oder POF3 k�nnen zum Warenempf�ger die Daten ausgelesen werden. \r\nDie Pflege der Daten wird nach Genehmigung durch die Produktionsleitung, Hrn. Willeke/ Scholzen, durch die PPS vorgenommen.\r\nKundenw�nsche in Debitorentexten sollten aus Performancegr�nden gel�scht werden.','Siegburg: For special customer wishes concerning packages the list in implented in modificated packaging instructions in SAP.\r\nWith transactions ZMM_PACK or POF3 you can see data for the receiver.\r\nData will be admitted by PPS Datateam after release by head of production M. Willeke or C. Scholzen.\r\nWishes in debitor texts should be deleted.','','','uploads/NEWS/pic_PackVorschr.JPG','Packaging instructions_2010-05-25_PDB.pdf',NULL,'','scholzen','2011-05-19 09:05:23'),(11,'2010-07-14','2010-07-20','DATENBANK Problem','DATABASE Problems','','','Wegen einer Umstellung in der Datenbank k�nnen derzeit keine Datenbl�tter als pdf-Datei ausgegeben werden. Die Programmierung wird in den n�chsten Tagen angepa�t. ','Caused by an administrative change within the database temporarly the dpf-datasheets are not printable. The programming will be changed within the next days.','','','uploads/NEWS/achtung.jpg','',NULL,'','scholzen','2010-07-20 15:07:08'),(12,'2010-07-28','2010-11-30','VPS 137 wird eleminiert','VPS 137 will be eliminated','','','Die 30L L�semittelkanne wird wg. Problemen mit Rost und der Transportsicherung durch den VPS 157 f�r L�semittelgemische abgel�st. Die St�cklisten der zuletzt gelieferten Produkte sind alle angelegt. Hier wird noch der Werksbestand aufgebraucht. Dieser reicht vorraussichtlich bis Oktober. Ansprechpartner SCM: Christoph Scholzen, BU: Andreas Beyer.','The can VPS 137 has problems with rust and transportation. Here all items are admitted as VPS 157. Actual the stock of cans is for 3 months, means that in October all customers have to change to VPS 157.\r\nYour contact SCM: Christoph Scholzen, BU: Andreas Beyer','','','uploads/NEWS/VPS137_front.jpg','',NULL,'','scholzen','2010-07-22 09:07:26'),(13,'2010-07-01','2010-09-30','VPS 601 l?uft aus.','VPS 601 phases out.','','','Mit der Einf�hrunng des VPS 615 (K-IBC-EX mit 255/80) soll der VPS 601 auslaufen.\r\nDie letzte Beschaffung f�r diesen VPS wurde schon durchgef�hrt.\r\nDer Vertrieb in Siegburg ist aufgefordert, alle Kunden auf VPS 615 umzustellen.\r\nAnsprechpartner: Thomas Ackermann','A standardization of plastic IBCs within Europe is driver for the implementation of VPS 615 as standard for solvent based inks in Siegburg.\r\nTherefor VPS 601 and later VPS 600 will be eleminated.\r\nActual the process of phasing out VPS 601 is running. The last IBCs of this types will be sold within the next weeks. Then all customers have to use VPS 615 instead of VPS 601. Your contact: Thomas Ackermann','','','uploads/NEWS/VPS601_Werit_PolyEX.jpg','',NULL,'','scholzen','2010-07-22 09:07:19'),(14,'2010-09-29','2011-03-31','VPS 162 - Neuer antistatischer Kanister','VPS 162 - New antistatic jerrican','','','Das bisherige 25kg Gebinde f�r die Luftfracht wurde heute gegen einen neuen, antistatisch ausger�steten Kanister ausgetauscht. Der Kanister verf�gt zudem �ber eine Permeationssperre, damit bei Unterdruck im Flugzeug keine L�semittel freigesetzt werden. \r\nDie SCM Siegburg verspricht sich ein einfacheres Handling und h�here Lieferzuverl�ssigkeit, da es bei dem alten Gebinde vom Flughafen vielfach Zur�ckweisungen wegen leichter bzw. marginaler Besch�digungen gegeben hat.\r\nF�r den Kunden ergeben sich in der Handhabung keine Unterschiede.','The former 25kg packaging for air freight cargo has today been changed to an antistatic plastic jerrican. Another feature of the jerrican is the permeation barrier to avoid contamination of solvent gases in the plane outside the can. \r\nSCM Siegburg preferres this can because there had been different problems with the old drum because airport checkers often refuse the packaging because of light damages.\r\nWith same handling attributes a better delivery perfomance for the customers are expected.\r\n','','','uploads/NEWS/IMG_3730.JPG','',NULL,'','scholzen','2011-02-28 10:02:08'),(15,'2011-02-27','2012-03-25','Veränderungen im Packmitteleinkauf','Change in purchasing packaging materials','','','Mit dem Ausscheiden von Thomas Ackermann bei Siegwerk �bernimmt Bernhard Wagner die Gesch�fte bis zur Nachbesetzung der Position.','Bernhard Wagner takes over responsibility for purchasing packaging materials until new purchaser follows Thomas Ackermann who left Siegwerk end of February.','','','','',NULL,'','scholzen','2012-03-26 15:03:48');

