/*Table structure for table `packmittel_dokumente` */

DROP TABLE IF EXISTS `packmittel_dokumente`;

CREATE TABLE `packmittel_dokumente` (
  `ID` int(255) NOT NULL AUTO_INCREMENT,
  `Beschreibung_GE` varchar(255) DEFAULT NULL,
  `Beschreibung_GB` varchar(255) DEFAULT NULL,
  `Beschreibung_PT` varchar(255) DEFAULT NULL,
  `Beschreibung_PL` varchar(255) DEFAULT NULL,
  `Sprache` int(20) DEFAULT NULL,
  `Datei` varchar(255) DEFAULT NULL,
  `Inhalt` blob,
  PRIMARY KEY (`ID`),
  UNIQUE KEY `Beschreibung_GE` (`Beschreibung_GE`)
) ENGINE=MyISAM AUTO_INCREMENT=24 DEFAULT CHARSET=latin1;

/*Data for the table `packmittel_dokumente` */

insert  into `packmittel_dokumente`(`ID`,`Beschreibung_GE`,`Beschreibung_GB`,`Beschreibung_PT`,`Beschreibung_PL`,`Sprache`,`Datei`,`Inhalt`) values (1,'Entsorgung: Rücknahmebedingungen (GB, GE, FR, ES, IT)','Disposal: Collection conditions (GB, GE, FR, ES, IT)',NULL,NULL,1,'uploads/PACKMITTEL_DOKUMENTE/Examples_ReturnConditions_2007-01.pdf',''),(2,'Stapelung von IBC','Stacking of IBC',NULL,NULL,1,'uploads/PACKMITTEL_DOKUMENTE/TechnInfo_Stapelfaehigkeit_von_IBC_2004-08-27.pdf',''),(7,'VPS 601 Handhabungsanweisung Kunststoff-IBC-EX','VPS 601 Handling instruction to Composite IBC',NULL,NULL,1,'uploads/PACKMITTEL_DOKUMENTE/Handhabungsanweisung Inland_2003-06.doc','Stand 06.2003'),(8,'VPS 173 - Hobbock mit Inliner (Verwendungshinweise)','VPS 173 - Pail with inliner',NULL,NULL,1,'uploads/PACKMITTEL_DOKUMENTE/TechnInfo_Hobbock_mit_Inliner_2005-01-14.pdf','Sehr geehrte Damen und Herren,vor etwa 5  Monaten haben wir Ihnen mitgeteilt, dass sich aus Sicht der BGR 132-Richtlinie �Vermeidung von Z�ndgefahren infolge elektrostatischer Aufladungen� Einschr�nkungen bei der Verwendung des Form-Inliners 992-3.2902 Form-Inliner 30 L aus LD-PE ergeben k�nnen. Insbesondere trifft dies zu, wenn Druckfarbe oder Lacke mit motorbetriebenen R�hrwerken aufger�hrt werden, da dann bei Verspritzen von Farbe oder Lack eine Ladungstrennung auftreten kann, welche eine Z�ndgefahr mit sich bringen kann. Wie Sie wissen, handelt sich bei dem obigen Inliner (s. Abb. 1) um eine Haube aus Polyethylen, welche als Einlage f�r 25kg Hobbocks verwendet wird, um eine Verunreinigung desselben durch Farbe zu vermeiden. Wir haben seinerzeit die Verwendung eines ableitf�higen Form-Inliners empfohlen, was auf der einen Seite erm�glicht, auch nicht geerdetes R�hrwerkzeug verwenden zu k�nnen. Andererseits bringt dies jedoch auch einen h�heren Preis des Inliners mit sich. Aus diesem Grund haben wir uns dieser Thematik erneut angenommen, um f�r Sie eine kosteng�nstigere und dennoch gleichfalls sichere M�glichkeit zu erarbeiten. Das Ergebnis dieser Untersuchung ist, das bei Einhaltung einiger Rahmen-bedingungen wie gewohnt der bei Ihnen bekannte Standard-Inliner 992-3.2902 weiterhin verwendet werden kann. Diese Rahmenbedingungen betreffen zum einen die Erdung des Hobbocks als auch zum anderen die des verwendeten motorgetriebenen R�hrwerkzeuges beim Aufr�hren von Farben und Lacken. Grunds�tzlich gilt, dass bei Entnahme der Druckfarbe aus einem Gebinde, wie z.B. einem Hobbock an der Druckmaschine, sicher zu stellen ist, dass hierbei das Gebinde geerdet ist. Dies gilt, wie Sie wissen, f�r alle Gebinde, aus denen Farben und Lacke entnommen werden, also auch f�r die Gebinde, die nicht mit einem Inliner ausgekleidet sind. Bei einem Hobbock erfolgt eine Erdung am g�nstigsten durch eine Erdungsklemme am Griff des Hobbocks. Bei Verwendung des nicht ableitf�higen PE-Inliners, muss zus�tzlich bei Verwendung von elektrisch oder pneumatisch getriebenen R�hrwerkzeugen eine Erdung der Fl�ssigkeit erfolgen. Dies geschieht am einfachsten �ber die Erdung dieser R�hrwerkzeuge. Erfolgt das Aufr�hren jedoch mit einem Holzpaddel ist eine Erdung der Fl�ssigkeit �blicherweise nicht notwendig, da bei diesem Verfahren nicht soviel Farbe verspritzt wird, dass es zu einer zu gro�en Ladungstrennung kommen kann. Nat�rlich muss auch hier das Metallgebinde bei der Entnahme geerdet sein. Hinsichtlich des Transports der Druckfarbe in einem entsprechend ausgekleideten Gebinde ergeben sich f�r Sie aus der BGR 132 keinerlei �nderungen, da hierbei keine ausreichend hohe Ladungstrennung auftreten kann. Zusammengefasst bedeutet das f�r Sie: -	Jedes Gebinde ist bei Entnahme, beim Bef�llen und beim R�hren generell, also auch wenn kein Inliner verwendet wird, zu erden. -	Ein motorgetriebenes oder pneumatisches R�hrwerkzeug ist bei Verwendung eines Inliners im Gebinde immer zu erden. -	Manuelles R�hren, z.B. mit einem Holzpaddel in dem geerdeten Gebinde mit Inliner ist ohne weitere Zusatzma�nahmen gefahrlos m�glich. Wir bitten Sie, diesen Text auch mit Ihrem Sicherheitsbeauftragten zu besprechen. Sollten Sie noch Fragen zu diesem Sachverhalt haben, geben wir Ihnen hierzu gerne weitere Ausk�nfte. Mit freundlichen Gr��en Siegwerk Druckfarben AG'),(11,'Entsorgung: Liste von Rekonditionierern in Deutschland','Disposal: List of reconditioners in Germany',NULL,NULL,1,'uploads/PACKMITTEL_DOKUMENTE/Rekonditionierer_Dt_2004-07.pdf',''),(13,'VPS 601 Ersatzteile/ Zubehör K-IBC (Fa. Schütz)','VPS 601 Spare parts/ accessories for plastic IBC (Sch?tz)',NULL,NULL,1,'uploads/PACKMITTEL_DOKUMENTE/Schuetz_brochure_ersatzteile.pdf',''),(18,'Ersatzteile: Armaturen u. Dichtungen','Spare parts: Valves and gaskets',NULL,NULL,1,'uploads/PACKMITTEL_DOKUMENTE/Container_Armaturen_u_Ersatzteile.xls',''),(21,'Entsorgung: Pack-one Ticket (gültig ab 07/ 2006)','Disposal: Pack-one ticket (valid since 07/ 2006)',NULL,NULL,1,'uploads/PACKMITTEL_DOKUMENTE/ReturnTicket_PackOne.pdf',''),(22,'Entsorgung: Rücknahmeinformationen (gültig ab 07/ 2006)','Disposal: Information for returning plastic IBC (valid since 07/2006)',NULL,NULL,1,'uploads/PACKMITTEL_DOKUMENTE/SW_Group_ReturnTickets_for_customers_2007-01-18.pdf','');

