insert  into `pdb_queries`(`ID_queries`,`MySQL_Query`,`Description_GE`,`Description_GB`,`Description_PT`,`Description_PL`,`Repl_Files`,`Repl_Fieldname`) values (1,'SELECT VPS_Nummer, ID_PM, Bezeichnung, referenz.Referenz_GE, firmen.Name, \r\nHoehe_Ueberalles AS Hoehe, if(referenz.Referenz_GE=\"Ja\",Hoehe_Ueberalles+Hoehe_Ueberalles_maxTol,\"\") AS Hmax, \r\nif(referenz.Referenz_GE=\"Ja\",Hoehe_Ueberalles-Hoehe_Ueberalles_minTol,\"\") AS Hmin, \r\nBreite_Rahmen AS Breite, Tiefe_Rahmen AS Tiefe, Gewicht_Gesamt AS GEW, \r\nif(referenz.Referenz_GE=\"Ja\", Gewicht_Gesamt+Gewicht_Gesamt_maxTol,\"\") AS Gmin, \r\nif(referenz.Referenz_GE=\"Ja\",Gewicht_Gesamt-Gewicht_Gesamt_minTol,\"\") AS Gmin, \r\nw1.MaterialName_GE AS Palette, PalletTypes_GE, w2.MaterialName_GE AS Behaelter, \r\nw3.MaterialName_GE AS Rahmen, v1.Name_GE, v1.Durchmesser, d1.Beschreibung_GE, \r\nd1.Material, Kupplung_GE, v2.Name_GE, v2.Durchmesser, \r\nd2.Beschreibung_GE \r\nFROM vps \r\nLEFT JOIN _vps_packmittel ON (_vps_packmittel.ID_VPS=vps.ID) \r\nLEFT JOIN packmittel_data ON (_vps_packmittel.ID_Packmittel=packmittel_data.ID_PM) \r\nLEFT JOIN referenz ON (packmittel_data.ID_ReferenzVerpackung=referenz.ID) \r\nLEFT JOIN packm_form ON (packmittel_data.ID_Packm_Form=packm_form.ID_packm_form) \r\nLEFT JOIN firmen ON (packmittel_data.ID_Hersteller=firmen.ID) \r\nLEFT JOIN pallet_types ON (ID_Palettentyp =pallet_types.ID_PalletTypes) \r\nLEFT JOIN kupplungen ON (ID_kupplungen_Kuppl1=kupplungen.ID) \r\nLEFT JOIN werkstoffe AS w1 ON (ID_werkstoffe_Palette=w1.ID) \r\nLEFT JOIN werkstoffe AS w2 ON (ID_werkstoffe_Behaelter=w2.ID) \r\nLEFT JOIN werkstoffe AS w3 ON (ID_werkstoffe_Rahmen=w3.ID) \r\nLEFT JOIN verschluesse AS v1 ON (ID_verschluesse_Einfuell=v1.ID) \r\nLEFT JOIN verschluesse AS v2 ON (ID_verschluesse_Auslauf1=v2.ID) \r\nLEFT JOIN dichtungen AS d1 ON (v1.ID_Dichtung=d1.ID) \r\nLEFT JOIN dichtungen AS d2 ON (v2.ID_Dichtung=d2.ID)\r\nWHERE Referenz_GE=\'Ja\'\r\nORDER by vps.VPS_Nummer,referenz.Referenz_GE','VPS mit Maße','VPS with measures','VPS with measures','VPS with measures','no exchange',''),(10,'SELECT VPS_Nummer, Bezeichnung, firmen.Name, un_zulassung.UN_Zulassungsnummer, un_zulassung.Dateiname \r\nFROM vps \r\nLEFT JOIN _vps_packmittel ON (vps.ID=_vps_packmittel.ID_VPS) \r\nLEFT JOIN packmittel_data ON (_vps_packmittel.ID_Packmittel=packmittel_data.ID_PM) \r\nLEFT JOIN un_zulassung ON (packmittel_data.ID_UN_Zulassung=un_zulassung.ID_un_zulassung) \r\nLEFT JOIN referenz ON (packmittel_data.ID_ReferenzVerpackung=referenz.ID) \r\nLEFT JOIN firmen ON (packmittel_data.ID_Hersteller=firmen.ID) ORDER BY VPS_Nummer','VPS - Zulassungen','VPS - Approvals','VPS - Homolgoations','VPS - Approvals','exchange by pic and link','Dateiname'),(15,'SELECT VPS_Nummer, ID_PM, Bezeichnung, un_zulassung.UN_Praegung, un_zulassung.Dateiname, Code,DichteX,DichteY,DichteZ\r\nFROM vps\r\nLEFT JOIN _vps_packmittel ON (vps.ID=_vps_packmittel.ID_VPS)\r\nLEFT JOIN packmittel_data ON (_vps_packmittel.ID_Packmittel=packmittel_data.ID_PM)\r\nLEFT JOIN un_zulassung ON (packmittel_data.ID_UN_Zulassung=un_zulassung.ID_un_zulassung)\r\nLEFT JOIN un_zulwerte ON (un_zulassung.ID_un_zulassung=un_zulwerte.ID_Zulassung)\r\nLEFT JOIN un_pruefmedium ON (un_zulwerte.ID_Pruefstoff=un_pruefmedium.ID)\r\nLEFT JOIN referenz ON (packmittel_data.ID_ReferenzVerpackung=referenz.ID)\r\nLEFT JOIN firmen ON (packmittel_data.ID_Hersteller=firmen.ID) \r\nORDER BY VPS_Nummer','VPS - Zulassungswerte','','','','exchange by pic and link','Dateiname'),(14,'SELECT VPS_Nummer as VPS, Bezeichnung_GE, Bezeichnung_GB, Bezeichnung_PT as Bezeichnung_F\r\nFROM vps\r\nORDER BY VPS_Nummer','VPS Liste m. Bezeichnungen','VPS list with descriptions','VPS list with descriptions','VPS list with descriptions','',''),(19,'SELECT  VPS_Nummer, \r\n        ID_PM, \r\n        Bezeichnung, \r\n        referenz.Referenz_GE, \r\n        firmen.Name, \r\n        Herst_Nummer,\r\n        Herst_Datenblatt,\r\n        if(Zeichnung_pdf,\'ja\',\'nein\') AS Zeichn,\r\n        Hoehe_Ueberalles AS Hoehe, \r\n        Hoehe_Ueberalles_maxTol AS Hmax, \r\n        Hoehe_Ueberalles_minTol AS Hmin, \r\n        Breite_Rahmen AS Breite, \r\n        Tiefe_Rahmen AS Tiefe,\r\n        Hoehe_Behaelter AS HRumpf, \r\n        Gewicht_Gesamt AS GEW,\r\n        Gewicht_Gesamt_maxTol AS GEWmax,\r\n        w2.MaterialName_GE AS Behaelter, \r\n        w3.MaterialName_GE AS Rahmen, \r\n        v1.Name_GE AS Verschlu�, \r\n        v1.Durchmesser AS Gr��e, \r\n        d1.Beschreibung_GE AS Dichtung, \r\n        d1.Material AS MatDtg \r\nFROM vps \r\nLEFT JOIN _vps_packmittel ON (_vps_packmittel.ID_VPS=vps.ID) \r\nLEFT JOIN packmittel_data ON (_vps_packmittel.ID_Packmittel=packmittel_data.ID_PM) \r\nLEFT JOIN referenz ON (packmittel_data.ID_ReferenzVerpackung=referenz.ID) \r\nLEFT JOIN packm_form ON (packmittel_data.ID_Packm_Form=packm_form.ID_packm_form) \r\nLEFT JOIN firmen ON (packmittel_data.ID_Hersteller=firmen.ID) \r\nLEFT JOIN pallet_types ON (ID_Palettentyp =pallet_types.ID_PalletTypes) \r\nLEFT JOIN kupplungen ON (ID_kupplungen_Kuppl1=kupplungen.ID) \r\nLEFT JOIN werkstoffe AS w2 ON (ID_werkstoffe_Behaelter=w2.ID) \r\nLEFT JOIN werkstoffe AS w3 ON (ID_werkstoffe_Rahmen=w3.ID) \r\nLEFT JOIN verschluesse AS v1 ON (ID_verschluesse_Einfuell=v1.ID) \r\nLEFT JOIN verschluesse AS v2 ON (ID_verschluesse_Auslauf1=v2.ID) \r\nLEFT JOIN dichtungen AS d1 ON (v1.ID_Dichtung=d1.ID) \r\nLEFT JOIN dichtungen AS d2 ON (v2.ID_Dichtung=d2.ID) \r\nWHERE firmen.Name like \'%Muhr%\'\r\nORDER by vps.VPS_Nummer,referenz.Referenz_GE','Alle Verpackungen - Fa. Muhr','All packagings of supplier Muhr','','','exchange by pic and link','Herst_Datenblatt'),(21,'SELECT \r\nUN AS IdentNr,\r\nVpGrp AS `VerpGrp.`,\r\n\'0,000\' AS `Dichte von`, \r\nif (VpGrp=\'II\'  ,IF(un_pruefmedium.Code=\"SOL\",replace(un_zulwerte.DichteY,\'.\',\',\'),IF(un_zulwerte.DichteY>0,replace(un_zulwerte.DichteY+0.090,\'.\',\',\'),\'\')), \r\nif (VpGrp=\'III\' ,IF(un_pruefmedium.Code=\"SOL\",replace(un_zulwerte.DichteZ,\'.\',\',\'),IF(un_zulwerte.DichteZ>0,replace(un_zulwerte.DichteZ+0.090,\'.\',\',\'),\'\')),\'\')) as \'Dichte bis\', \r\nif (vps_MWE_materials.MaterialCode IS NULL,SAP_Nummer,vps_MWE_materials.MaterialCode) AS SAP_Nummer,  \r\nUN_Name,\r\nAssim,\r\nVerpInnen, \r\nvps.vps_nummer,\r\nID_PM, \r\nif(VpGrp=\'II\' AND un_pruefmedium.Code!=\"SOL\",\r\n             IF(VolVerGrpII>Ueberlaufvolumen,replace(Ueberlaufvolumen,\'.\',\',\'),replace(VolVerGrpII,\'.\',\',\')),\r\n             IF(VolVerGrpIII>Ueberlaufvolumen,replace(Ueberlaufvolumen,\'.\',\',\'),replace(VolVerGrpIII,\'.\',\',\'))) AS VOLUMEN,\r\n`Einheit`,\r\nun_pruefmedium.Code\r\n\r\nFROM un_tabelle, \r\nun_verpanweisung, un_gebindecode,un_zulassung, un_zulwerte,un_pruefmedium, vps, _vps_packmittel, packmittel_data, _sparten_vps, divisions \r\nLEFT JOIN vps_MWE_materials ON (vps.VPS_Nummer=vps_MWE_materials.VPS_Nummer AND LEFT(vps_MWE_materials.MaterialCode,1)=\'1\')\r\nWHERE     (un_tabelle.VerpVorschr=un_verpanweisung.VerpVorschrift OR un_tabelle.IBCVorschr=un_verpanweisung.VerpVorschrift)\r\nAND       un_verpanweisung.VerpInnen=un_gebindecode.CODE\r\nAND       un_zulassung.ID_Gebindetyp=un_gebindecode.ID\r\nAND       un_zulassung.ID_un_zulassung=un_zulwerte.ID_Zulassung\r\nAND       un_zulwerte.ID_Pruefstoff=un_pruefmedium.ID\r\nAND       packmittel_data.ID_UN_Zulassung=un_zulassung.ID_un_zulassung\r\nAND       _vps_packmittel.ID_Packmittel=packmittel_data.ID_PM\r\nAND       vps.ID=_vps_packmittel.ID_VPS\r\nAND       packmittel_data.ID_ReferenzVerpackung=2\r\nAND       IF(assim=\"SOL\",assim=un_pruefmedium.Code,1=1)\r\nAND       IF(VerpInnen LIKE \'%H%\',assim LIKE CONCAT(\'%\',un_pruefmedium.Code,\'%\'),IF(un_pruefmedium.Code=\"SOL\",assim=un_pruefmedium.Code,1=1))\r\nAND       IF(VerpInnen LIKE \'%H%\',(ExplGrp IS NULL or ExplGrp=\'IIA\' or ExplGrp=\'no\'),1=1)\r\nAND       IF(VerpInnen LIKE \'%H%\' AND Permeation =\'high\',ID_PermSperre=1,1=1)\r\nAND       IF(VerpInnen LIKE \'%H%\' AND Klasse LIKE \'3\',ID_ExZone!=9,1=1)\r\nAND       vps.status=1\r\n\r\nAND       (vps.ID=_sparten_vps.ID_VPS AND _sparten_vps.ID_Standard!=6 \r\n           AND _sparten_vps.ID_SPARTE=divisions.ID AND divisions.DIV_Matchcode=\'SU_Pck\' OR divisions.DIV_Matchcode=\'F-Anne\')\r\n\r\nORDER BY  vps.VPS_Nummer, UN,VpGrp,un_pruefmedium.Code','EHSVP Liste (f?r SAP Import)','EHSVP List (for SAP import)','EHSVP List (for SAP import)','EHSVP List (for SAP import)','no exchange',''),(22,'SELECT YEAR (TIMESTAMP_personen) AS Jahr, MONTH (TIMESTAMP_personen) AS Monat, count(*) as \'Last User Login\'\r\n FROM personen GROUP BY Jahr, Monat ORDER BY TIMESTAMP_personen DESC','Letzter Login','Last Login','Last Login','Last Login','no exchange',''),(23,'SELECT * FROM `pdb_records` WHERE pdbtable =\'pdb_queries\' ORDER BY REC_TIMESTAMP DESC','Recrds - ge?nderte Daten','','','','no exchange',''),(1000,'SELECT VPS_Nummer, \r\nBezeichnung, \r\nMedium_GE, \r\nDichteX, \r\nDichteY, \r\nDichteZ, \r\nUeberlaufvolumen*0.94 AS `max F�llvol`\r\nFROM vps LEFT JOIN _vps_packmittel ON (_vps_packmittel.ID_VPS=vps.ID) \r\nLEFT JOIN packmittel_data ON (_vps_packmittel.ID_Packmittel=packmittel_data.ID_PM) \r\nLEFT JOIN _sparten_vps ON (vps.ID=_sparten_vps.ID_VPS) LEFT JOIN divisions ON (divisions.ID=_sparten_vps.ID_Sparte) \r\nLEFT JOIN un_zulassung ON (packmittel_data.ID_UN_Zulassung=un_zulassung.ID_un_zulassung) \r\nLEFT JOIN un_zulwerte ON (un_zulassung.ID_un_zulassung=un_zulwerte.ID_Zulassung) \r\nLEFT JOIN un_pruefmedium ON (un_pruefmedium .ID=un_zulwerte.ID_Pruefstoff) \r\nLEFT JOIN referenz ON (packmittel_data.ID_ReferenzVerpackung=referenz.ID) \r\nWHERE referenz.ID=2 AND (DichteX!=0 OR DichteY!=0 OR DichteZ!=0) \r\nAND divisions.DIV_Matchcode=\'SU_Pck\' ORDER by vps.VPS_Nummer,referenz.Referenz_GE','VPS - Dichte (f?r PPS)','VPS - Density (for PPS)','','','no exchange',''),(1001,'SELECT \r\nUN AS IdentNr, \r\nVpGrp AS `VerpGrp.`, \r\n\'0,000\' AS `Dichte von`, \r\nif (VpGrp=\'II\' ,IF(un_pruefmedium.Code=\"SOL\",replace(un_zulwerte.DichteY,\'.\',\',\'),\r\n  IF(un_zulwerte.DichteY>0,replace(un_zulwerte.DichteY+0.090,\'.\',\',\'),\'\')), \r\n  if (VpGrp=\'III\' ,IF(un_pruefmedium.Code=\"SOL\",replace(un_zulwerte.DichteZ,\'.\',\',\'),\r\n  IF(un_zulwerte.DichteZ>0,replace(un_zulwerte.DichteZ+0.090,\'.\',\',\'),\'\')),\'\')) \r\nas \'Dichte bis\',\r\nif (vps_MWE_materials.MaterialCode IS NULL,SAP_Nummer,vps_MWE_materials.MaterialCode) AS SAP_Nummer,  \r\nUN_Name,\r\nIF(VerpInnen LIKE \'%H%\' AND Klasse LIKE \'%3%\', IF(ExzoneNo like \'EX%\',0,1),0) AS `NA ATEX`,\r\nIF(VerpInnen LIKE \'%H%\' AND Permeation =\'high\' AND ID_PermSperre!=1,1,0) AS `NA PERM`,\r\nIF(VerpInnen LIKE \'%H%\' AND ExplGrp=\'IIC or IIB MZE smaller 0.2mJ\',1,0) AS `NA EXPL`,\r\nIF(assim=\"SOL\", IF(assim=un_pruefmedium.Code,0,1),0) AS `NA AGGR`,\r\nAssim,\r\nVerpInnen, \r\nvps.vps_nummer,\r\nID_PM, \r\nif(VpGrp=\'II\' AND un_pruefmedium.Code!=\"SOL\",\r\n      IF(VolVerGrpII >Ueberlaufvolumen,replace(Ueberlaufvolumen,\'.\',\',\'),replace(VolVerGrpII,\'.\',\',\')),\r\n      IF(VolVerGrpIII>Ueberlaufvolumen,replace(Ueberlaufvolumen,\'.\',\',\'),replace(VolVerGrpIII,\'.\',\',\'))\r\n  ) AS VOLUMEN,\r\n`Einheit`,\r\nun_pruefmedium.Code\r\nFROM un_tabelle\r\nLEFT JOIN un_verpanweisung ON (un_tabelle.VerpVorschr=un_verpanweisung.VerpVorschrift OR un_tabelle.IBCVorschr=un_verpanweisung.VerpVorschrift)\r\nLEFT JOIN un_gebindecode ON un_verpanweisung.VerpInnen=un_gebindecode.CODE\r\nLEFT JOIN un_zulassung ON un_zulassung.ID_Gebindetyp=un_gebindecode.ID\r\nLEFT JOIN un_zulwerte ON un_zulassung.ID_un_zulassung=un_zulwerte.ID_Zulassung\r\nLEFT JOIN un_pruefmedium ON un_zulwerte.ID_Pruefstoff=un_pruefmedium.ID\r\nLEFT JOIN packmittel_data ON packmittel_data.ID_UN_Zulassung=un_zulassung.ID_un_zulassung\r\nLEFT JOIN exzone ON exzone.Exzone_ID=packmittel_data.ID_ExZone\r\nLEFT JOIN _vps_packmittel ON _vps_packmittel.ID_Packmittel=packmittel_data.ID_PM\r\nLEFT JOIN vps ON vps.ID=_vps_packmittel.ID_VPS\r\nLEFT JOIN _sparten_vps ON (vps.ID=_sparten_vps.ID_VPS AND _sparten_vps.ID_Standard!=6)\r\nLEFT JOIN divisions ON (_sparten_vps.ID_SPARTE=divisions.ID AND (divisions.DIV_Matchcode=\'SU_Pck\' OR divisions.DIV_Matchcode=\'F-Anne\'))\r\nLEFT JOIN vps_MWE_materials ON (vps.VPS_Nummer=vps_MWE_materials.VPS_Nummer AND LEFT(vps_MWE_materials.MaterialCode,1)=\'1\')\r\nWHERE     packmittel_data.ID_ReferenzVerpackung=2\r\nAND       vps.status=1\r\nORDER BY  vps.VPS_Nummer, UN,VpGrp,un_pruefmedium.Code','EHSVP für SAP-Import','EHSVP for SAP-Import','EHSVP für SAP-Import','','no exchange','');

/*Table structure for table `pdb_records` */

DROP TABLE IF EXISTS `pdb_records`;

CREATE TABLE `pdb_records` (
  `ID_pdb_records` int(100) NOT NULL AUTO_INCREMENT,
  `pdbtable` varchar(255) DEFAULT NULL,
  `prim_id` int(255) DEFAULT NULL,
  `field` varchar(255) DEFAULT NULL,
  `value` varchar(255) DEFAULT NULL,
  `user` varchar(255) DEFAULT NULL,
  `REC_TIMESTAMP` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`ID_pdb_records`)
) ENGINE=MyISAM AUTO_INCREMENT=2860 DEFAULT CHARSET=latin1;

