/*Data for the table `safetydocs` */

insert  into `safetydocs`(`ID_safetydocs`,`ID_VPS`,`Beschreibung_GE`,`Beschreibung_GB`,`Beschreibung_PT`,`Beschreibung_PL`,`Sprache`,`Datei`,`Inhalt`,`Safetydocs_Timestamp`,`Safetydocs_LastAdmin`) values (1,'115','Risikoanaylse elektrostatischer Gefahren','Risk assessment of electrostatic hazards','Analyse de risdue d\' électrostatique danger','Risk assessment of electrostatic hazards','GB','uploads/safetydocs/Risk assessment of plastic IBC using in Ex-zones_2007-08-14.pdf','Risk assessment of electrostatic hazards for using plastic IBC in Ex-zones\r\n\r\nPlastic IBC are used with flammable liquid inks of explosion group IIA and IIB with min. ignition energy of 0,2 mJ or non-flammable liquid inks. This matrix should help to prevent hazardous situations by technical or organisational measures.\r\n\r\ncategory	description of handling	description details	creation of \r\nelectrostatic charges	other risks for ignition of explosive atmosphere	prevention \r\nmoving	move with handlifter		not expected	not expected	\r\n	move with folk lifter	wooden pallet	not expected	not expected	\r\n		plastic pallet	expected\r\nif pallet is not protected	not expected	use only IBC specified for use in Ex-zone 1\r\n		galvanized metal pallet 	not expected	formation of sparks possible if metal sheet pallet will be pushed over the floor	do not handle in Ex-zones with folk lifter\r\n\r\n\r\ncategory	description of handling	description details	creation of \r\nelectrostatic charges	other risks for ignition of explosive atmosphere	prevention \r\noutside manipulation	fix label on plastic bulk		possible	not expected	do not fix any labels on the plastic bulk (organizational measure)\r\n	fix label on metal label sheet		possible,\r\nif earthed  not expected	not expected	\r\n	remove label from plastic bulk		possible	not expected	do not fix any labels on the plastic bulk (organizational measure)\r\n	remove label from metal label sheet		possible,\r\nif earthed  not expected	not expected	\r\n	open/ close top lid	non protected lid/ lid area (means: only insulating plastic material without any dissipative material)	probably  by rubbing on surface while opening the top lid\r\n	not expected	use only IBC specified for use in Ex-zone 1 or \r\nprotect area at top lid with metal grid/ net which is earthed &#61664; this measure has to be done by all manipulators in the supply chain!\r\n\r\n\r\ncategory	description of handling	description details	creation of \r\nelectrostatic charges	other risks for ignition of explosive atmosphere	prevention \r\noutside manipulation	open/ close top lid	metal sheet covered IBC (Sch�tz SX) with cut-out at lid/ lid area	possible  by rubbing on surface while opening the top lid	not expected	as in the lid area the metal cover is cut-out, rubbing on insulating surface is possible if the user is unskilled (organizational measure) \r\n		antistatic IBC (outside layer of bulk is of antistatic material)	not expected	not expected	\r\n	open/ close cap of valve		not expected	not expected	\r\n	open valve	non-protected IBC (without earthable valve)	possible,\r\nif IBC is not Ex-protected		as you cannot ground liquid before opening the valve it is not possibility to prevent sparking\r\n		Ex-protected IBC with earthable valve	not expected	not expected	\r\n	close valve		not expected	not expected	\r\n	put earthed standpipe from top opening into liquid 		probably, if liquid is charged and not grounded 	not expected	as you cannot ground liquid before opening the top there is no possibility to prevent sparking (=ignition of ex-atmosphere) \r\n	remove dirt and dust from outer surface of plastic bulk\r\ne.g. with a cloth	non-protected/ insulating IBC	expected	not expected	after cleaning outer surface  wait more than 24h before refilling (organizational measure)\r\n		metal sheet covered IBC (Sch�tz SX) with cut-out at lid/ lid area	not expected	not expected	\r\n		antistatic IBC (outside layer of bulk is of antistatic material)	not expected	not expected	\r\n\r\n\r\n\r\n\r\n\r\ncategory	description of handling	description details	creation of \r\nelectrostatic charges	other risks for ignition of explosive atmosphere	prevention \r\ncleaning	clean outer surface of plastic bulk with pressured liquid		expected	not expected	do not handle in ex-zone while cleaning; if IBC had contained flammable liquids, first wash careful, then ventilate and at least clean it;\r\nafter cleaning wait more than 24h before refilling\r\n	clean outer surface of metal sheet cover (only Sch�tz SX)		expected	not expected	do not handle in ex-zone while cleaning; if IBC had contained flammable liquids, first wash careful, then ventilate and at least clean it;\r\nafter cleaning wait more than 24h before refilling\r\n	clean metal label sheet		probably, \r\nif IBC is earthed not expected	not expected	\r\n\r\ncategory	description of handling	description details	creation of \r\nelectrostatic charges	other risks for ignition of explosive atmosphere	prevention \r\nfilling	from top to bottom	non-/ semi-\r\nconductive liquid	expected/ highest risk	not expected	\r\n		conductive liquid,\r\nIBC and valve not earthed	probably	not expected	as you cannot ground liquid with this filling method, it is not allowed (organizational measure)\r\n		conductive liquid,\r\nIBC and valve earthed (only possible for Ex-protected ones)	not expected	not expected	\r\n	from bottom to top, from outlet valve \r\nor near the fluid level	non-/ semi-\r\nconductive liquid, conductive hose and low fluid velocity	not expected	not expected	\r\n		conductive liquid	not expected	not expected	\r\n\r\n\r\ncategory	description of handling	description details	creation of \r\nelectrostatic charges	other risks for ignition of explosive atmosphere	prevention \r\nemptying	outlet with ankle (of insulating plastic)		not expected \r\n(tests showed that charges were created but of a lower potential than it could be dangerous)	not expected	\r\n	non-conductive pipe/ hose 		probably		use conductive pipes/ hoses (technical measure)\r\n	conductive pipe or conductive hose with insulating adapter for connection to IBC		possible\r\n(tests showed that charges were created but of a lower potential than it could be dangerous)	not expected	bridge insulating adapter by earthing IBC and pipe/ hose with the same potential (technical measure)\r\n	with earthed standpipe through top opening		not expected if fluid velocity is slow	not expected	\r\n	with insulating adapter, conductive hose and pump (all earthed)		possible		bridge insulating adapter by earthing IBC and pipe/ hose with the same potential (technical measure)\r\nlimit max. fluid velocity in hose and pump with reduced power of pump (organizational measure)\r\n \r\n\r\ncategory	description of handling	description details	creation of \r\nelectrostatic charges	other risks for ignition of explosive atmosphere	prevention \r\nmixing \r\n(low velocity)	manual paddle\r\n		not expected	not expected	\r\nmixing \r\n(fast velocity)	with special mixer 	non-/ semi-\r\nconductive liquid	expected/ highest risk	not expected	created charges cannot dissipated through the non-/ semi-conductive liquid; an ignition is expected!\r\n		conductive liquid,\r\nIBC and liquid (mixer) not earthed	expected/ highest risk	not expected	created charges cannot dissipated through the non-/ semi-conductive liquid; an ignition is expected!\r\n		conductive liquid,\r\nIBC, liquid and mixer earthed	probably	not expected	if mixer is very fast and mixing in phase interface/ fluid level, splashing liquid will increase creating of charges; in this case an ignition is possible!\r\n\r\nDo not mix while emptying! Only mix if container is closed! (organizational measure)\r\n\r\nExplanation \r\n\r\n(background color)\r\nwhite			uncritical\r\nyellow			possible critical if safety measure are neglected \r\nred			critical and safety measures essential or not to use\r\n\r\n(text)\r\nnormal			uncritical\r\nred/ bold	 	(possible) critical\r\n','2016-05-12 18:28:04','Scholzen'),(2,'115','Betriebsanleitung f?r K-IBC-EX','Handling instruction for ridged plastic IBC-EX','Instruction de service de GRV-EX plastique','Operation manual for R-IBC-EX','GB','uploads/safetydocs/R-IBC-EX_Handling-instruction_2007-07.pdf','Handling instruction for ridged plastic IBC-EX\r\n		\r\n\r\nDue to the fact that standard plastic IBC are made of non-conductive polyethylene, the surface could be loaded with electrostatic charges. Such loadings are dangerous because they cause an ignition. If such ignitions will happen in explosive atmospheres like Ex-zones a critical incident like an explosion could reason. \r\n\r\nTo prevent such incidents plastic IBC with dissipating features have been developed. They are called plastic IBC-EX. These plastic containers are constructed as transport and storage container for flammable liquids, like printing inks. The outer surface of the standard plastic bulk is covered by an antistatic-layer or metal sheet cover to prevent electrostatic charges. The outlet valve is conductive and has electrical contact to the filling good. \r\n\r\nFurther handling precautions are required for safety use:\r\nIncoming inspection\r\nWith the supply of the one-way plastic IBC, the ownership changes to the receiver as like pails or drums. After unloading, the IBC has to be checked on the following items:\r\n\r\na)	Does the IBC have a yellow label on the metal plate which certified the container for using in EX-zone 1?\r\nb)	Does the IBC have an earthing wire between metal cage and valve?\r\nc)	Does the IBC contain any damages on frame, pallet or bulk?\r\n\r\nSafety use\r\nd)	In principle the IBC has to be earthed/ grounded. \r\ne)	If security screw exists on outlet valve please remove. Otherwise the valve will be damaged and closing could be impossible. If security stick is of plastic it could be opened without removing.\r\nf)	Do not rub on the plastic bulk and prevent rubbing on the surface while opening the top lid.\r\ng)	Do not mix without addition safety requirements (see below)\r\n\r\nFilling\r\nh)	Earthing of the IBC should be ensured before filling starts\r\ni)	Without further safety precautions a permanent earthed conductive fill pipe extended almost to the bottom of the IBC should be used\r\nj)	Prevent squirting of liquid by filling from bottom to top\r\n\r\nEmptying\r\nk)	Earthing of the IBC should be ensured before emptying.\r\nl)	The top opening has to be opened to prevent a vacuum inside the IBC\r\nm)	Prevent rubbing on the plastic bulk while opening the top lid\r\nn)	After emptying the top opening has to be closed.Only use conductive hoses for connecting IBC and pump. Using the standard plastic adapter S60x6 to male thread/ camlok coupling a separate ground to earth of IBC and hose is needed. The adapter is an isolator. \r\no)	When emptying with a pump the flow rate of 1 m/s, equivalent to 120 L/min, should not be exceeded with DN 50 (explosion safety). In the pressure sector emptying rates above 120 L/min are normally not achieved with pumps.\r\n\r\nMixing\r\np)	Without further safety precautions mixing is not allowed due to the fact that mixing is a highly charge generation process. \r\n\r\nq)	Mixing is possible if following precautions are fulfilled:\r\n�	Printing ink is a high-conductive liquid\r\n�	Mixer accords ATEX for Ex-zone 1\r\n�	Propeller and axel are of conductive material and earthed to ground\r\n�	Prevent that propeller mixes in the phase interface because of squirting liquid\r\n�	Do not empty IBC while mixing\r\nDisposal\r\nr)	Emptied and undamaged containers could be returned to reconditioneers for free if the requirements for returning IBC are fulfilled\r\ns)	If rest-ink of more than 20L is in, most of the reconditioneers offer disposal of rest-ink for payment.\r\nt)	Returning to reconditioneer is a dangerous good transport.\r\n\r\nPlease see additional information:  	Return information, Return conditions, Pack-One- Ticket\r\nStorage\r\nu)	In maximum, 3 filled plastic IBC could be stacked.\r\nv)	Prevent fires in stock.\r\n\r\nWhen handling the plastic IBC the regulations for safe handling of hazardous substances and the use of personal protective measures (work clothing, goggles, gloves, etc.) to avoid contamination must be complied with. \r\nProduction information can be found in our safety data sheets.\r\n\r\n\r\nDisclaimer:\r\nThis instruction manual for ridged plastic IBC-Ex describes hazards and safety precautions to avoid critical incidents while using these IBC.\r\nThe data are based on the Technical Report �Electrostatics - Code of practice for the avoidance of hazards due to static electricity� (CENELEC TR 50404:2003), the German BGR132 (�Vermeidung von Z�ndgefahren infolge elektrostatischer Aufladung�), scientific publications regarding hazards with plastic IBC and on experts� reports. The information and recommendations contained herein are not intended to relieve the reader of responsibility to take note of and comply with existing legal provisions. The information and recommendations provided herein are believed by the authors and the publisher to be accurate at the time of preparation or obtained from sources believed to be reliable. They should, however, not be regarded as exhaustive. \r\nSIEGWERK make no warranty, expressed or implied; concerning this publication or the accuracy of the information contained herein, and will not be liable for injury or claims pertaining to any use of this document or the information contained herein. The authors and the publisher will make every effort to update or amend this publication where new information becomes available or where there are changes in laws or regulations, but they do not assume any obligation for this.\r\n','2008-03-03 14:37:33','scholzen');

