/*Table structure for table `un_zulassung` */

DROP TABLE IF EXISTS `un_zulassung`;

CREATE TABLE `un_zulassung` (
  `ID_un_zulassung` int(10) NOT NULL AUTO_INCREMENT,
  `ID_Gebindetyp` int(10) DEFAULT NULL,
  `UN_Praegung` varchar(80) DEFAULT NULL,
  `UN_Zulassungsnummer` varchar(20) DEFAULT NULL,
  `ID_Zulassungsinhaber` int(10) DEFAULT NULL,
  `ID_Aggregat` int(10) DEFAULT NULL,
  `ID_Verkehrsraum` int(10) NOT NULL DEFAULT '1',
  `Dateiname` varchar(255) DEFAULT NULL,
  `Dateipfad` varchar(255) DEFAULT NULL,
  `Ausstellungsdatum` date DEFAULT NULL,
  `PE_Permeationstest` varchar(10) DEFAULT NULL,
  `BruttoGewicht` float(5,1) DEFAULT NULL,
  `Fassungsraum` float(5,1) DEFAULT NULL,
  `Einheit` char(2) DEFAULT 'L',
  `TS_un_zulassung` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `LA_un_zulassung` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`ID_un_zulassung`),
  KEY `ID_Gebindetyp` (`ID_Gebindetyp`),
  KEY `ID_Zulassungsinhaber` (`ID_Zulassungsinhaber`),
  KEY `ID_Aggregat` (`ID_Aggregat`)
) ENGINE=MyISAM AUTO_INCREMENT=118 DEFAULT CHARSET=latin1;

