  `ID` int(10) NOT NULL AUTO_INCREMENT,
  `UNZulRaum_GE` varchar(255) DEFAULT NULL,
  `UNZulRaum_GB` varchar(255) DEFAULT NULL,
  `UNZulRaum_PT` varchar(255) DEFAULT NULL,
  `UNZulRaum_PL` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`ID`),
  UNIQUE KEY `Name_GE` (`UNZulRaum_GE`)
) ENGINE=MyISAM AUTO_INCREMENT=6 DEFAULT CHARSET=latin1;

/*Data for the table `un_zulassungsraum` */

insert  into `un_zulassungsraum`(`ID`,`UNZulRaum_GE`,`UNZulRaum_GB`,`UNZulRaum_PT`,`UNZulRaum_PL`) values (1,'Strasse/ Schiene','road/ rail','road/ rail','road/ rail'),(2,'Strasse/ Schiene & See','road/ rail & sea','road/ rail & sea','road/ rail & sea'),(3,'Strasse/ Schiene, See & Luft','road/ rail, sea & air','road/ rail, sea & air','road/ rail, sea & air'),(4,'See','sea','sea','sea'),(5,'Luft','air','air','air');

